import React from "react";
import Icon from "./icon";
import Home from "../icons/iconfinder_ic_home_48px_3669170.png";
import Fire from "../icons/iconfinder_ic_videocam_48px_3669181.png";
import Subscriptions from "../icons/iconfinder_ic_view_module_48px_3669149.png";
import PlayList from "../icons/iconfinder_icon-ios7-bell_211694.png"

export function Sidebar(props) {
  return <div className="sidebar">
    <Icon iconUrl = {Home} title="Home"/>
    <Icon />
    <Icon />
    <Icon />
  </div>;
}
